import React, { FC } from "react";
import "./userprofile.css";

const User: FC = () => {
  return (
    <form >
    <input name="email" type="email" />
    <input name="password" type="password"/>
    <input name="passwordConfirmation" type="password"  />
    <button type="submit">
      Save
    </button>
  </form>
  );
};
export default User;
